def average[T](ts: Iterable[T])(implicit num: Numeric[T]) = {
    num.toDouble( ts.sum ) / ts.size
}

val swr_a = cas_nt.map(line => line.split(","))
                  .map(arr => (arr(0).substring(0,10),//yyyy-mm-dd
                               (arr(0).substring(11,16),//hh:mm
                                arr(57).toDouble)   //idx57 = swr
                              )
                      )
                  .filter(_._2._2 > 0)
                  .filter(_._2._2 < 100)
                  .groupByKey           //group by date
                  .map(t => (t._1, t._2.toList)) //date, (hour, swr)
                  .map(t => (t._1, t._2
                                    .map(s => (s._1.split(":")(0),
                                               s._2))
                                    .groupBy(s => s._1)
                                    .toList)
                            )
                  .map(t => (t._1,  //date
                             t._2   //arr((hour,list((hour,swr))))
                              .map(s => (s._1.toInt,
                                         average(s._2.map(_._2))
                                        )
                                  )
                            )
                      )     //arr((date,arr((hour,swr_avg))))
