def replaceNone(s: String):Int = {
    if (s == "-") -1
    else s.toInt
}

val rdd_fp_all = fp.map(_.split(","))
val rdd_fp = rdd_fp_all.map(a => (a(0).split(" ")(0),
                                   (a(0).split(" ")(1)
                                        .split(":")(0).toInt,
                                     (replaceNone(a(1)),
                                      replaceNone(a(2)))
                                   )
                                 )
                            )
                       .groupByKey
                       .map(t => (t._1, t._2.toList))
                    //   .collect

val rdd_swr_fp = swr_a.join(rdd_fp).collect
var rdd_result = sc.parallelize(Array[(Double, Int, Int)]())
for(e <- rdd_swr_fp){
    try{
        val rls1 = sc.parallelize(e._2._1)
        val rls2 = sc.parallelize(e._2._2)
        val srs = get_sunriseset_time(e._1)

        val risetime = srs("rise").split(":")(0).toInt
        val settime = srs("set").split(":")(0).toInt

        val rdd_tmp = rls1.join(rls2)
                         .map(t => (
                             t._1,      //hour
                             (t._2._1, t._2._2._1, t._2._2._2)  //swr,pm10,pm25
                         ))
                         .filter(_._1 > risetime)
                         .filter(_._1 < settime)
                         .map(t => (t._2._1, t._2._2, t._2._3))  //swr,pm10,pm25
        rdd_result = rdd_result ++ rdd_tmp
    } catch {
        case e: ArrayIndexOutOfBoundsException => {

        }
    }
}

rdd_result.collect
val df_swr_fp = rdd_result.toDF("swr", "pm10", "pm25")
df_swr_fp.createOrReplaceTempView("swr_fp")

